const INITIAL_STATE = {
  productSection: [
    {
      id: 1,
      title: "hats",
      image:
        " https://images.ctfassets.net/5de70he6op10/6jZ55m4laSQ27tvuIAb205/a881f1e6487322d9da1a8e59314ea31a/011121_HPG_LS_1.jpg",
      sectionLink: "hats",
      width: "650px",
      height: "500px",
    },

    {
      id: 2,
      title: "jackets",
      image:"https://i1.wp.com/artmyideas.com/wp-content/uploads/2018/12/50-Beautiful-Bedroom-Wall-Art-Ideas-And-Decorations-16.jpg?w=1200&ssl=1",
      width:'300px',
      height:'350px',
      sectionLink: "jackets",
    },
    {
      id: 3,
      title: "mens",
      image:
        "https://www.planetorganic.com/images/categories/small_AUTO_VeganGroceries.jpg",
      sectionLink: "mens",
    },
    {
      id: 4,
      title: "womens",
      image:
        "https://www.planetorganic.com/images/categories/small_VEGAN_OFFERS.jpg",
      size: "large",
      sectionLink: "womens",
    },
    {
      id: 5,
      title: "sneakers",
      image:
        "https://www.planetorganic.com/images/categories/small_VEGAN_OFFERS.jpg",
      size: "large",
      sectionLink: "sneakers",
    },
  ],
};

const dirctoryReducer = (state = INITIAL_STATE, action) => {
  switch (action.type) {
    case "DISPLAY_DIRECTORY":
      return {
        state,
      };

    default:
      return state;
  }
};

export default dirctoryReducer;
